//global variables 
int i = 0; 
int space_counter = 0; 
int current_position = 0; 
int beans_collected = 0; 
int number_of_packages = 1; 
int total_packages_dropped = 0; 
int beans_dropped = 0; 
int beans_height = 0; 
bool PENGUIN_HOLDING_BEAN = FALSE;
bool BEANS_ON_CRATE = FALSE; 
bool GAME_OVER = FALSE;
bool BACK_PRESSED = FALSE;
bool L_PRESSED = FALSE; 
bool HARD = FALSE;
bool MEDIUM = FALSE;
bool EASY = FALSE;
int hex_value;
bool LEVEL_SELECTED = FALSE;
bool KEY_I_PRESSED = FALSE;
bool KEY_ENTER_PRESSED = FALSE;

volatile int* pixel_ctrl_ptr = (int*)PIXEL_BUF_CTRL_BASE;
volatile int * KEY_ptr = (int *)KEY_BASE;
volatile int * LED_ptr = (int *)LEDR_BASE;

int main(void) {
	i = 0; 
	space_counter = 0; 
	current_position = 0; 
	beans_collected = 0; 
	number_of_packages = 1; 
	total_packages_dropped = 0; 
	beans_dropped = 0; 
	beans_height = 0; 
	PENGUIN_HOLDING_BEAN = FALSE;
	BEANS_ON_CRATE = FALSE; 
	GAME_OVER = FALSE;
	BACK_PRESSED = FALSE;
	L_PRESSED; 
	HARD = FALSE;
	MEDIUM = FALSE;
	EASY = FALSE;
	LEVEL_SELECTED = FALSE;
	KEY_I_PRESSED = FALSE;
	KEY_ENTER_PRESSED = FALSE;
	
	*(LED_ptr) = 0b0000000000;
	*(pixel_ctrl_ptr + 1) = 0xC8000000;
	wait_for_vsync();
	pixel_buffer_start = *pixel_ctrl_ptr;

	clear_screen();

	*(pixel_ctrl_ptr + 1) = 0xC0000000;
	pixel_buffer_start = *(pixel_ctrl_ptr + 1);

	//PS/2 keyboard setup
	volatile int* PS2_ptr = (int*)PS2_BASE;
	int PS2_data, RVALID;
	char byte1 = 0, byte2 = 0, byte3 = 0,  key_pressed;
	bool LEVEL_SELECTED = FALSE;

	//clear the field (reset) 
	*(PS2_ptr) = 0xFF;

	clear_screen();
	
	//Beginning Intro Screen 
	while (!KEY_I_PRESSED && !KEY_ENTER_PRESSED) {
		printf("main screen printed\n");
		draw_mainscreen();
		wait_for_vsync();
		pixel_buffer_start = *(pixel_ctrl_ptr + 1);

		//check what key was pressed on the keyboard 
		PS2_data = *(PS2_ptr);
		RVALID = PS2_data & 0x8000;
		if (RVALID) {
			//shift the next data byte into the display 
			key_pressed = PS2_data;
			byte1 = byte2;
			byte2 = byte3; 
			byte3 = PS2_data & 0xFF;

			//check if the key pressed is enter or I for Instructions 
			if (key_pressed == 0x43) {
				printf("i pressed\n");
				KEY_I_PRESSED = TRUE;
				clear_screen();
				wait_for_vsync(); // swap front and back buffers on VGA vertical sync
				pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
				clear_screen();
				wait_for_vsync(); // swap front and back buffers on VGA vertical sync
				pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
				
				while(!BACK_PRESSED) {
					PS2_data = *(PS2_ptr);
					RVALID = PS2_data & 0x8000;
		
					if (RVALID) {
						//shift the next data byte into the display 
						key_pressed = PS2_data;
						byte1 = byte2;
						byte2 = byte3; 
						byte3 = PS2_data & 0xFF;

						draw_instructions();
						wait_for_vsync(); // swap front and back buffers on VGA vertical sync
						pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
						draw_instructions();
						wait_for_vsync(); // swap front and back buffers on VGA vertical sync
						
						pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
						if(key_pressed == 0x66) {
							BACK_PRESSED = TRUE;
						}
					}
				}
				KEY_I_PRESSED = false; //CHANGED; SET TO FALSE INCASE USER CLICKS I AGAIN
				BACK_PRESSED = false; //CHANGED; SET TO FALSE INCASE USER CLICKS BACKSPACE AGAIN
				main(); 
			}
			
			if (key_pressed == 0x5A) {
				while(!LEVEL_SELECTED) {
					
					if (RVALID) {
						//shift the next data byte into the display 
						key_pressed = PS2_data;
						byte1 = byte2;
						byte2 = byte3; 
						byte3 = PS2_data & 0xFF;

						draw_select_level();
						wait_for_vsync(); // swap front and back buffers on VGA vertical sync
						pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
						draw_select_level();
						wait_for_vsync(); // swap front and back buffers on VGA vertical sync
						
						pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
						
						//Enter this loop to check for button press
						while(1) {
							//If Key 1 is pressed, easy mode, so one LED lights up
							//Break out of while loop to continue to game play
							if(*KEY_ptr == 0b0010) {
								*(LED_ptr) = 0b0000000001;
								LEVEL_SELECTED = TRUE;
								EASY = TRUE;
								break;
							}
							//If Key 2 is pressed, medium mode, so two LEDs light up
							//Break out of while loop to continue to game play
							else if(*KEY_ptr == 0b0100) {
								*(LED_ptr) = 0b0000000011;
								LEVEL_SELECTED = TRUE;
								MEDIUM = TRUE;
								break;
							}
							//If Key 3 is pressed, hard mode, so three LEDs light up
							//Break out of while loop to continue to game play
							else if(*KEY_ptr == 0b1000) {
								*(LED_ptr) = 0b0000000111;
								LEVEL_SELECTED = TRUE;
								HARD = TRUE;
								break;
							}
							//If any other configuration, no LEDs light up, and reset key value
							//No break so we can loop again for user input
							else {
								*(LED_ptr) = 0b0000000000;
								*(KEY_ptr) = 0b0000;
							}
						}
					}
						
				}		
				for(int i = 0; i < 6; i++)
				{
					draw_lets_play();
					wait_for_vsync(); // swap front and back buffers on VGA vertical sync
					pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
					draw_lets_play();
					wait_for_vsync(); // swap front and back buffers on VGA vertical sync
					pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
				}
				KEY_ENTER_PRESSED = TRUE;
			}
		}
	}

	//check which KEY was pressed 
	if (KEY_ENTER_PRESSED) {
		clear_screen();
		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		clear_screen();
		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer

		draw_background();
		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		draw_background();
		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		
		
		//address of the timer and counter is set-up 
		volatile int* timer = 0xFFFEC600; 
		int timer_value = 200000000; //updates every second
		int timer_99;
		if(HARD) {
			timer_99 = 26; 
		}
		if(MEDIUM) {
			timer_99 = 51; 
		}
		if(EASY) {
			timer_99 = 100; 
		}
		
		//setting up the interrupts 
		disable_A9_interrupts();
 		set_A9_IRQ_stack();
 		config_GIC();
 		config_PS2();
 
 		enable_A9_interrupts();
		
		//actual gameplay 
		//drawing the penguin 
		while(!GAME_OVER) {
			
			//start the timer 
			volatile int* interrupt_status_reg = 0xFFFEC60C; 
			*interrupt_status_reg = 15; 
				if (timer_99 == 0) {
					GAME_OVER = TRUE;
					LEVEL_SELECTED = FALSE;
					*(KEY_ptr) = 0b0000;
					*(LED_ptr) = 0b1111111111;
					
					for(int i = 0; i < 6; i++)
					{
						draw_time_is_up();
						wait_for_vsync(); // swap front and back buffers on VGA vertical sync
						pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
						draw_time_is_up();
						wait_for_vsync(); // swap front and back buffers on VGA vertical sync
						pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
					}	
					break;
				}
			//update the timer and display on the HEX 
			timer_99 = timer_99 - 1; 
			display(timer_99); 
		
			//after the HEX, then update the A9 timer for 1 second 
			do_delay();
			
			if(beans_collected > 4 ) { 
				break;
			}
	    wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		cases();	
			
		//Keyboard input from PS/2
		PS2_data = *(PS2_ptr);
		RVALID = PS2_data & 0x8000;
		}
	}
}


//beginning screen 	
