//hex display 
void display(int timer_value) {
	volatile int* hex_display = 0xFF200020; 
		int value = timer_value/10; //the tens value
		int tens_value = hex_display_number(value); 
		tens_value = tens_value << 8; 
		int remainder = timer_value - (value * 10); //ones value
		int ones_value = hex_display_number(remainder); 
	
		int total = tens_value + ones_value; 
		
		*hex_display = total; 
}

void do_delay() {
	//update the load time
	volatile int* A9_Private_Timer = 0xFFFEC600; 
	int A9_load_time = 250000000; 
	*A9_Private_Timer = A9_load_time; 
	
	//update AE 
	volatile int* A9_Control = 0xFFFEC608; 
	*A9_Control = 3; 
	
	//wait loop 
	volatile int* A9_Interrupt = 0xFFFEC60C; 
	while(1) {
		if (*A9_Interrupt == 1) {
			break; 
		}
	}
	
}

//hex display number 
int hex_display_number(int timer_value) {
		if (timer_value == 0)
		return hex_value = 63; 
	
		else if (timer_value == 1) 
		return hex_value = 6; 
 
		else if (timer_value == 2) 
		return hex_value = 91; 
			
		else if (timer_value == 3) 
		return hex_value = 79; 

		else if (timer_value == 4) 
		return hex_value = 102; 

		else if (timer_value == 5) 
		return hex_value = 109; 
	
		else if (timer_value == 6) 
		return hex_value = 125; 
	
		else if (timer_value == 7) 
		return hex_value = 7;
	
		else if (timer_value == 8) 
		return hex_value = 127;
	
		else if (timer_value == 9) 
		return hex_value = 103; 
	
}


